import { Grid, TextField, Typography, Button, Input } from '@mui/material'; 
import { useNavigate } from 'react-router-dom';
import { useState } from 'react'

const Login = (props) => {
    const [athleteName, setAthleteName] = useState("");
    const [athleteError, setAthleteError] = useState('');

    const onButtonClick = () => {
        setAthleteError('')
    }

    return (
        <>
            <Grid item>
            <TextField label="Athlete ID" required>
                <Input onChange={(ev) => setAthleteName(ev.target.value)} />
            </TextField>
            <Button onClick={onButtonClick}>Login</Button>
            <label>{isAuthenticated ? <div>Welcome {athleteName}</div>: <div />}</label>
            </Grid>
        </>
    )
}

export const LoginPage = () => {
    
    const navigate = useNavigate()
    const routeChangeForgotId = () => {
        let path = "/forgotId";
        navigate(path)
    }
    const routeChangeNewAthlete = () => {
        let path = "/newAthlete";
        navigate(path)
    }
    return <Grid container sx={{
        justifyContent: "center"
        }}>
        <Grid item>
            <Typography variant="h1">
            Welcome to Legacy Boxing!
            </Typography>
        </Grid>
        <Grid container item xs={12} columnSpacing={3} rowSpacing={3} sx={{
            justifyContent: "center",
            paddingTop: "1rem",
            alignItems: "center"
        }}>
            {/* <Grid item>
            <TextField label="Athlete ID" required></TextField>
            </Grid> */}
            <Grid item>
            <Login />
            </Grid>
        </Grid>
        <Grid container item xs={12} columnSpacing={3} rowSpacing={3} sx={{
            justifyContent: "center",
            paddingTop: "1rem",
            alignItems: "center"
        }}>
            <Grid item>
            <Button onClick={ () => routeChangeForgotId() }>Forgot ID</Button>
            </Grid>
        </Grid>
        <Grid container item xs={12} columnSpacing={3} rowSpacing={3} sx={{
            justifyContent: "center",
            paddingTop: "1rem",
            alignItems: "center"
        }}>
            <Grid item>
            <Button onClick={ () => routeChangeNewAthlete() }>New Athlete</Button>
            </Grid>
        </Grid>
    </Grid>  
}
